import React from 'react';
import '../App.css';

import Shirt1 from '../assets/shirts/1.jpg'

import Overlay from '../components/Overlay';

function Look() {
    return <div className='Main'>
        <Overlay />
        <img className='Bordered Shadowed' width='300px' src={Shirt1} alt={"shirt1"} />
    </div>
}

export default Look;
